subSubSection.paragraph:
Cell V much shorter than cell IV, not connected with cell III. Septum IV–V oblique, curved. Outer appendage unbranched, typically darkened, up to 400 µm long. Inner appendage consisting of a small basal cell typically giving rise to 2–3 superposed cells supporting paired terminal antheridia, although varying greatly with age, sometimes including additional antheridia and sterile branches of very variable length. [Detailed descriptions: 
Majewski 1994b
; 
Santamaria 1998
]

